import './write.css';
import writeImage from '../../assets/write.jpg';

export default function Write() {
	return (
		<div className="write">
			<img className="writeImg" src={writeImage} alt="" />
			<from className="writeForm ">
				<div className="writeFormGroup" action="">
					<i class="fa-solid fa-plus"></i>
					<input type="file" id="fileinput"></input>
					<input type="text" placeholder="Title"></input>
					<input className="writeSubmit" type="submit" value="Publish"></input>
				</div>
			</from>
		</div>
	);
}
